import cv2
import numpy as np
import cv2 
from google.colab.patches import cv2_imshow

image = cv2.imread('PTTN8522.JPG', flags=cv2.IMREAD_COLOR)

cv2_imshow(image)
cv2.waitKey(0)
cv2.destroyAllWindows()

"""![81269Capture.png](data:image/png;base64,)"""

kernel = np.array([[-1, -1, -1],
                   [-1, 8,-1],
                   [-1, -1, -1]])
#kerne=np.multiply(1/9,kernel)
image_sharp = cv2.filter2D(src=image, ddepth=-1, kernel=kernel)
cv2_imshow(image_sharp)
cv2.waitKey()
cv2.destroyAllWindows()